package com.talent.forex.bean.model;

public class OcoAndMarketModel {

	private String ccy1;
	private String ccy2;
	private String tradeDirection;
	private String tAmount;
	private String tPrice;
	private String sAmount;
	private String sPrice;
	private String monitorPrice;
	private String activeTime;
	private String cancelTime;
	
	public OcoAndMarketModel() {
		super();
		// TODO Auto-generated constructor stub
	}

	public OcoAndMarketModel(String ccy1, String ccy2, String tradeDirection,
			String tAmount, String tPrice, String sAmount, String sPrice,
			String monitorPrice, String activeTime, String cancelTime) {
		super();
		this.ccy1 = ccy1;
		this.ccy2 = ccy2;
		this.tradeDirection = tradeDirection;
		this.tAmount = tAmount;
		this.tPrice = tPrice;
		this.sAmount = sAmount;
		this.sPrice = sPrice;
		this.monitorPrice = monitorPrice;
		this.activeTime = activeTime;
		this.cancelTime = cancelTime;
	}

	public String getCcy1() {
		return ccy1;
	}

	public void setCcy1(String ccy1) {
		this.ccy1 = ccy1;
	}

	public String getCcy2() {
		return ccy2;
	}

	public void setCcy2(String ccy2) {
		this.ccy2 = ccy2;
	}

	public String getTradeDirection() {
		return tradeDirection;
	}

	public void setTradeDirection(String tradeDirection) {
		this.tradeDirection = tradeDirection;
	}

	public String gettAmount() {
		return tAmount;
	}

	public void settAmount(String tAmount) {
		this.tAmount = tAmount;
	}

	public String gettPrice() {
		return tPrice;
	}

	public void settPrice(String tPrice) {
		this.tPrice = tPrice;
	}

	public String getsAmount() {
		return sAmount;
	}

	public void setsAmount(String sAmount) {
		this.sAmount = sAmount;
	}

	public String getsPrice() {
		return sPrice;
	}

	public void setsPrice(String sPrice) {
		this.sPrice = sPrice;
	}

	public String getMonitorPrice() {
		return monitorPrice;
	}

	public void setMonitorPrice(String monitorPrice) {
		this.monitorPrice = monitorPrice;
	}

	public String getActiveTime() {
		return activeTime;
	}

	public void setActiveTime(String activeTime) {
		this.activeTime = activeTime;
	}

	public String getCancelTime() {
		return cancelTime;
	}

	public void setCancelTime(String cancelTime) {
		this.cancelTime = cancelTime;
	}

}
